import Cabecalho from "../Cabecalho/Index";
import Rodape from "../Rodape/Rodape";
import "./TelaServicos.css"

const TelaServicos = () => {
    return (<div>
                <Cabecalho/>
                <div className="container-servico-gerenciati">

                    <img src="./imagens/gerenciamentoti"></img>


                </div>


            <Rodape/>

    </div>  );
}
 
export default TelaServicos;
